import React from 'react';
import Header from './components/Header';
import Footer from './components/Footer';

function App() {
  return (
    <div className="App">
        <Header 
          titulo = 'Cencaval'
        />

        <Footer 
          footer = 'Esto es el footer'
        />
    </div>
  );
}

export default App;
